import st1img from"./images/img.png";

const images = [{
    id: 1,
    src: st1img,
    alt: "Image 1 not found"
},
{
    id: 2,
    src: "images/2.jpg",
    alt: "Image 2 not found"
},
{
    id: 3,
    src: "images/3.jpg",
    alt: "Image 3 not found"
}
];
export default images;
